webpackJsonp([0xdc040d82e599],{395:function(a,e){a.exports={data:{site:{siteMetadata:{title:"MAC0213 Blog",author:"Victor Hugo M. Pinto"}},markdownRemark:{id:"/Users/victorhugo/Projects/mac213-blog/src/pages/planning/index.md absPath of file >>> MarkdownRemark",html:"<p>Em reunião realizada no dia 08 de março às 16h na Secretaria Municipal de Inovação e Tecnologia (SMIT), localizada no centro de São Paulo, conheci meu supervisor pessoalmente, Eduardo Spanó e demais membros da SMIT que estarão envolvidos de alguma maneira no projeto. Durante a reunião conversamos sobre o <em>background</em> de cada um dos participantes e tivemos uma primeira noção de como o planejamento seria feito, dado o meu conhecimento prévio e disponibilidade de trabalhar na SMIT quando necessário.</p>\n<p>O planejamento que derivamos para o projeto, assumindo uma dedicação média de 8 horas semanais, é o seguinte:</p>\n<table>\n<thead>\n<tr>\n<th>Semana</th>\n<th>Atividade</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Semana 1 (25/03)</td>\n<td>Pesquisar ferramentas e aprender sobre GitLab CI</td>\n</tr>\n<tr>\n<td>Semana 2</td>\n<td>Receber os códigos + modelo da VM + estudar a aplicação</td>\n</tr>\n<tr>\n<td>Semana 3, 4, 5 e 6</td>\n<td>Conteinerizar a aplicação</td>\n</tr>\n<tr>\n<td>Semana 7, 8 e 9</td>\n<td>Automatizar o deploy</td>\n</tr>\n<tr>\n<td>Semana 10</td>\n<td>Sistematizar aprendizados e próximos passos</td>\n</tr>\n<tr>\n<td>Semana 11, 12</td>\n<td>Oficinas de aprendizados</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Horas</strong>: 1 hora</p>",frontmatter:{title:"Planejamento",date:"April 03, 2018"}}},pathContext:{slug:"/planning/",previous:null,next:null}}}});
